import React from 'react';

export default function Header({ TotalQuestion, onStartQuiz }) {
    return (
        <section className="welcome">
            <h1 className="quiz-title">Welcome to the Quiz</h1>
            <p className="quiz-questions">Total Questions: {TotalQuestion}</p>
            <button className="start-btn" onClick={onStartQuiz}>Start Quiz</button>
        </section>
    );
}
